import * as React from "react";

function SvgComp(props) {
  return <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" {...props}><circle cx={12} cy={12} r={12} fill="#005f87" /><circle cx={12} cy={12} r={11.5} fill="none" stroke="#464646" strokeMiterlimit={10} /><g fill="#fff"><path d="M15 5.994H6v8.996h1V6.994h8v-1z" /><path d="M17 8H7.99v8.997h1V9H17V8z" /><path d="M9.995 9.995v9h9v-9zm8 8H11V11h7z" /></g></svg>;
}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24">  <circle cx="12" cy="12" r="12" fill="#005f87"/>  <circle cx="12" cy="12" r="11.5" fill="none" stroke="#464646" stroke-miterlimit="10"/>  <g>    <polygon points="15 5.994 6 5.994 6 14.99 7 14.99 7 6.994 15 6.994 15 5.994" fill="#fff"/>    <polygon points="17 8 7.99 8 7.99 16.997 8.99 16.997 8.99 9 17 9 17 8" fill="#fff"/>    <path d="M9.995,9.995v9h9v-9Zm8,8H11V11h7Z" fill="#fff"/>  </g></svg>';
        export const SvgComponent = React.memo(SvgComp);
